import React from 'react';

function GiangVienDashboard() {
  return (
    <div className="max-w-6xl mx-auto p-6 min-h-screen bg-gradient-to-br from-gray-50 to-white">
      <h1 className="text-3xl font-bold text-green-700 text-center mb-6">Giảng Viên Dashboard</h1>
      <p className="text-center text-gray-700">Chào mừng bạn đến với giao diện giảng viên.</p>
    </div>
  );
}

export default GiangVienDashboard;
